import axios from 'axios';

const URL: string = 'https://api.turku.fi/linkedevents/v1/event/?page=';
// const URL_PAGE = `https://api.turku.fi/linkedevents/v1/image/?page=`;
const FetchEventsTurku = async (i: number) => {
  const response: any = await axios.get(URL + i);
  return response;
}
export default FetchEventsTurku;
